import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App()
{
    return( 
        <div>
            <Header />
            {notes.map(noteItem => (
                <Note 
                    key = {noteItem.key} 
                    name = {noteItem.name} 
                    text = {noteItem.text}
                />
            ))}
            <Footer />
        </div>
    );
}

export default App;
